import React from "react";
import {
    DetailWrapper,
    Title,
    Content
} from "./detail_style";

class Detail extends React.Component{
    render(){
        return (
            <DetailWrapper>
                <Title>那些扎心的网易云热评（句句扎心）</Title>
                <Content>
                    <p>后来我发现，

                    太浓烈的东西总是不长久

                    应了那句老话

                    第一眼就心动的人没法做朋友   

                    ——《阁楼》 ​​​</p>
                    <p>“希望你以后能过得好，别辜负我一生不打扰。”



——网易云音乐热评《到不了》 ​ ​​​​</p>
                </Content>
            </DetailWrapper>
        )
    }
}
export default Detail;
